import React, { Component,Fragment } from 'react';


class ShowPlayers extends Component {
  constructor(props){
    super(props)
    this.state = {
      players : props.location.state.playersInGame
    }
  }
  render() {
    console.log(this.state.players)
    let index = 0;
    return (
      <Fragment>
        <table>
        <thead>
        <th>Player Name</th>
          <th>Last Name</th>
          <th>Total Time</th>
          <th>Distance (km)</th>
          <th>Sprint Distance</th>
          <th> Total Sprints</th>
          <th>Sprints Avg(MP/H).</th>
        </thead>
        {this.state.players.map((player, index) => (
          <td>{player}</td>
        ))}

        </table>
      </Fragment>
    )
  }
}
export default ShowPlayers;
